// client/src/components/PeopleInAir.jsx

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Form.css';

export default function PeopleInAir() {
  const [rows, setRows]       = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError]     = useState('');

  const fetchData = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/people_in_air');
      setRows(res.data);
      setError('');
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to load people in air');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="view-container">
      <h2>People in the Air</h2>
      <button
        className="refresh-btn"
        onClick={fetchData}
        disabled={loading}
      >
        {loading ? 'Loading…' : 'Refresh'}
      </button>
      {error && <p className="error-text">{error}</p>}

      <table className="data-table">
        <thead>
          <tr>
            <th>Departing From</th>
            <th>Arriving At</th>
            <th># Airplanes</th>
            <th>Airplane List</th>
            <th>Flight List</th>
            <th>Earliest Arrival</th>
            <th>Latest Arrival</th>
            <th># Pilots</th>
            <th># Passengers</th>
            <th># Total</th>
            <th>Person List</th>
          </tr>
        </thead>
        <tbody>
          {rows.map((r, idx) => (
            <tr key={idx}>
              <td>{r.departing_from}</td>
              <td>{r.arriving_at}</td>
              <td>{r.num_airplanes}</td>
              <td>{r.airplane_list}</td>
              <td>{r.flight_list}</td>
              <td>{r.earliest_arrival}</td>
              <td>{r.latest_arrival}</td>
              <td>{r.num_pilots}</td>
              <td>{r.num_passengers}</td>
              <td>{r.joint_pilots_passengers}</td>
              <td>{r.person_list}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
